import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'highlight2'
})
export class HighlightPipe2 implements PipeTransform {

  transform(value : string = '', input: ''): string {
    console.log('value is ', value);
    console.log('input is', input);
    return '<h1>';
  }

}
